const domains = JSON.parse(outputStr);

// Now you can process each domain as an object!
return domains;

function getRequiredSamples(volume) {
  if (volume < 75) return 3;
  if (volume < 100) return 4;
  if (volume < 125) return 5;
  if (volume < 150) return 6;
  if (volume < 175) return 7;
  if (volume < 200) return 8;
  // For volumes >= 200, use strict 1 per 25 m³ rule for regulatory defensibility
  return Math.ceil(volume / 25);
}

// This assumes your input array is stored as the first item's "output" field, as a stringified JSON array
const domainArray = typeof $('AI Agent').first().json.output === 'string' ? JSON.parse($('AI Agent').first().json.output) : $('AI Agent').first().json.output;

const results = domainArray.map(domain => {
  const volume = Number(domain.volume);
  const samples = Number(domain.samples_taken);
  const required = getRequiredSamples(volume);

  return {
    name: domain.name,
    volume: volume,
    samples_taken: samples,
    required_samples: required,
    status: samples >= required ? "OK" : "DEFICIENT",
    shortfall: samples >= required ? 0 : required - samples
  };
});

return results.map(r => ({ json: r }));

const stockpiles = $input.all().map(item => item.json);

const deficientStockpiles = stockpiles.filter(stockpile => stockpile.status === "DEFICIENT");
const okStockpiles = stockpiles.filter(stockpile => stockpile.status === "OK");
const completed = deficientStockpiles.length === 0;

return [{
    json: {
        deficient_domains: deficientStockpiles,
        ok_domains: okStockpiles,  // Add this if you want to see the OK ones too
        completed: completed,
        total_stockpiles: stockpiles.length,
        deficient_count: deficientStockpiles.length,
        ok_count: okStockpiles.length
    }
}];

